create table pcr_repay
(
    id                             varchar(64)    not null comment '主键ID',
    order_id                       varchar(64)    null comment '订单流水号',
    serial_id                      varchar(64)    null comment '数据流水号',
    etl_id                         varchar(64)    null comment '清洗流水号',
    report_id                      varchar(32)    null comment '报告编号',
    pri_bor_identity_cat           varchar(60)    null comment '主借款人身份类别',
    org_type                       varchar(60)    null comment '业务管理机构类型',
    org_no                         varchar(60)    null comment '业务管理机构代码',
    repay_business_code            varchar(60)    null comment '业务种类',
    establish_datetime             datetime       null comment '开立日期',
    repay_due_datetime             datetime       null comment '到期日期',
    repayment_liability_persontype varchar(60)    null comment '相关还款责任人类型',
    repay_account_no               varchar(100)   null comment '保证合同编号',
    repayment_liability_amount     decimal(12, 2) null comment '相关还款责任金额',
    currency                       varchar(60)    null comment '币种',
    repay_balance                  decimal(12, 2) null comment '余额',
    repay_five_level_code          varchar(60)    null comment '五级分类',
    repay_account_code             varchar(60)    null comment '账户类型',
    repay_status                   varchar(60)    null comment '还款状态',
    overdue_month                  int            null comment '逾期月数',
    update_datetime                datetime       null comment '信息报告日期',
    create_time                    datetime       not null comment '入库时间',
    primary key (id, create_time)
)
    comment 'D_03-相关还款责任信息' engine = InnoDB;

create index idx_etl_report
    on pcr_repay (etl_id, report_id);

